import React from "react";

import ExpensesForm from "./ExpensesForm";
import "./NewExpense.css";

const NewExpenses = () => {
  return (
    <div className="new-expenses">
      <form>
        <ExpensesForm />
      </form>
    </div>
  );
};

export default NewExpenses;
